import { Typography } from '@material-ui/core';
import { IconButton, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import React from 'react';
import { Close} from '@mui/icons-material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import useStyles from './style';
import ButtonBase from '@material-ui/core/ButtonBase';
import EmailIcon from '@mui/icons-material/Email';
import CodeIcon from '@mui/icons-material/Code';
// eslint-disable-next-line react/prop-types
function Menu({onClose, itemPressed, customRefs}) {

	const renderItem=(text,Icon,ref)=>{
		return (


			<ListItem button key='About Us'>
				<ListItemIcon><Icon/>
				</ListItemIcon>
				<ListItemText primary='About Us' />
			</ListItem>

		);
	};
	const classes = useStyles();
	const menuItems = [
		{
			title:'About',icon:AccountCircleIcon,desitnation:customRefs[0]
		},
		{
			title:'Projects',icon:CodeIcon,desitnation:customRefs[1]
		},
		{
			title:'contact',icon:EmailIcon,desitnation:customRefs[2]
		}];
	return (
		<div className={classes.menu}>
			<IconButton onClick={onClose} className={classes.close} >
				<Close className={classes.icon}/>
			</IconButton>
			<List>
				{menuItems.forEach((item)=> renderItem(item.title,item.icon,item.desitnation))}
			</List>
		</div>
	);
}
export default Menu;
